import Layout from "../components/Layout";
import React from "react";
import styled from "styled-components";
import Icon from "../components/Icon";
const TagsSection = styled.section`
  
`
const NotesSection = styled.section`
  
`

const CategorySection = styled.section`

`
const NumberPadSection = styled.section`

`
const TagList = styled.ol`
  display: flex;
  flex-direction: row;
  flex-wrap: wrap;
  padding-left: 5px;
  padding-right: 5px;
  padding-top: 5px;
  margin-right: -5.665px;
  >li{
    width: 120px;
    height: 120px;
    margin-right: 5.665px;
    text-align: center;
    border-radius: 50%;
    border: 1px solid black;
    display: flex;
    flex-direction: column;
    align-items: center;
    font-size: 8px;
    margin-bottom: 5px;
    .icon{
      width: 100px;
      height: 100px;
      display: inline-block;
      margin-top: 8px;
      fill:none;
    }
  }
`
function Count() {
    return (
        <Layout>
            <TagsSection>
                <TagList>
                    <li><Icon name="food" ></Icon>餐饮</li>
                    <li><Icon name="rent" ></Icon>房租</li>
                    <li><Icon name="clothes" ></Icon>服装</li>
                    <li><Icon name="bodybuilding" ></Icon>健身</li>
                    <li><Icon name="travel" ></Icon>旅行</li>
                    <li><Icon name="makeup" ></Icon>美容</li>
                    <li><Icon name="car" ></Icon>汽车</li>
                </TagList>
            </TagsSection>
            <NotesSection>

            </NotesSection>
            <CategorySection>

            </CategorySection>
            <NumberPadSection>
                <div>
                    100
                </div>
                <div>
                    <button>1</button>
                    <button>2</button>
                    <button>3</button>
                    <button>DELETE</button>
                    <button>4</button>
                    <button>5</button>
                    <button>6</button>
                    <button>CLEAR</button>
                    <button>7</button>
                    <button>8</button>
                    <button>9</button>
                    <button>OK</button>
                    <button>0</button>
                    <button>.</button>
                </div>
            </NumberPadSection>
        </Layout>
    );
}
export default Count;
